    const [isParked ,setParked] = useState(false);

    const onParkedClick = ()=>{
        updateLat(getUserCurrentLocation())
    }

    return(<div>
            <NavBarComp />    
            <button onClick={()=> onParkedClick }>Save Location</button>
            {latLng ?   <CarParkedComp lat={latLng.lat} lng={latLng.lng} />  : <div>No Location Found</div>}
        </div> )
    }



